import React from 'react';
import { NavLink } from 'react-router-dom';
import { Card, Button } from 'react-bootstrap';

function CardSensor(props) {
    return (
        <div>
            <Card className="text-center" style={{ minWidth: "18rem" }}>
                <Card.Img src="https://cdn.iconscout.com/icon/premium/png-512-thumb/ph-balanced-1916308-1624203.png" alt="" />
                <Card.ImgOverlay>
                    <Card.Title><p style={{ textAlign: "center"}}>PH</p></Card.Title>
                </Card.ImgOverlay>
                <Card.Text>
                    This is a wider card with supporting text below as a natural lead-in to
                    additional content. This content is a little bit longer.
                </Card.Text>
            </Card>


        </div>
    );
}

export default CardSensor;
